          adjective
        </Typography>
        <Typography variant="body2" component="p">
          well meaning and kindly.
          <br />
          {'"a benevolent smile"'}
        </Typography>
      </CardContent>
      <CardActions>
          <ReactFileReader handleFiles={handleFiles} fileTypes={'.csv'}>
            <Button className='btn'>Upload</Button>
          </ReactFileReader>
      </CardActions>
    </Card>
  );
}

export default UploadFile;
